INSERT INTO `maillog` VALUES (1,'','vivian@quilted.coop','vivian@quilted.coop','','a:7:{s:12:\"MIME-Version\";s:3:\"1.0\";s:12:\"Content-Type\";s:51:\"text/plain; charset=UTF-8; format=flowed; delsp=yes\";s:25:\"Content-Transfer-Encoding\";s:4:\"8Bit\";s:8:\"X-Mailer\";s:6:\"Drupal\";s:11:\"Return-Path\";s:19:\"vivian@quilted.coop\";s:6:\"Sender\";s:19:\"vivian@quilted.coop\";s:4:\"From\";s:19:\"vivian@quilted.coop\";}','New release(s) available for pottery','There are updates available for one or more of your modules or themes. To\nensure the proper functioning of your site, you should update as soon as\npossible.\n\nSee the available updates page for more information:\nhttp://localhost/usr/local/Cellar/drush/6.3.0/libexec/admin/reports/updates\n\nYour site is currently configured to send these emails when any updates are\navailable. To get notified only for security updates,\nhttp://localhost/usr/local/Cellar/drush/6.3.0/libexec/admin/reports/updates/settings.\n',1404405816);
